import React, { Component } from "react";
const RadioInput = ({ type, name, value, label }) => {
  return (
    <div>
      <label htmlFor={name} className="radio_label">
        {label}
        &nbsp;
      </label>
      <input type={type} name={name} value={value} />
    </div>
  );
};

export default RadioInput;
